<?xml version="1.0" encoding="ISO-8859-1"?>
<PARAMETERS version="1.7.0" xsi:noNamespaceSchemaLocation="https://raw.githubusercontent.com/OpenMS/OpenMS/develop/share/OpenMS/SCHEMAS/Param_1_7_0.xsd" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">
  <NODE name="CometAdapter" description="Annotates MS/MS spectra using Comet.">
    <ITEM name="version" value="2.6.0-pre-disabled-20200418" type="string" description="Version of the tool that generated this parameters file." required="false" advanced="true" />
    <NODE name="1" description="Instance &apos;1&apos; section for &apos;CometAdapter&apos;">
      <ITEM name="in" value="" type="input-file" description="Input file" required="true" advanced="false" supported_formats="*.mzML" />
      <ITEM name="out" value="" type="output-file" description="Output file" required="true" advanced="false" supported_formats="*.idXML" />
      <ITEM name="database" value="" type="input-file" description="FASTA file" required="true" advanced="false" supported_formats="*.FASTA" />
      <ITEM name="comet_executable" value="comet.exe" type="input-file" description="The Comet executable. Provide a full or relative path, or make sure it can be found in your PATH environment." required="true" advanced="false" />
      <ITEM name="pin_out" value="" type="output-file" description="Output file - for Percolator input" required="false" advanced="false" supported_formats="*.tsv" />
      <ITEM name="default_params_file" value="" type="input-file" description="Default Comet params file. All parameters of this take precedence. A template file can be generated using &apos;comet.exe -p&apos;" required="false" advanced="false" supported_formats="*.txt" />
      <ITEM name="precursor_mass_tolerance" value="5.0" type="double" description="Precursor monoisotopic mass tolerance (Comet parameter: peptide_mass_tolerance).  See also precursor_error_units to set the unit." required="false" advanced="false" />
      <ITEM name="precursor_error_units" value="ppm" type="string" description="Unit of precursor monoisotopic mass tolerance for parameter precursor_mass_tolerance (Comet parameter: peptide_mass_units)" required="false" advanced="false" restrictions="amu,ppm,Da" />
      <ITEM name="isotope_error" value="off" type="string" description="This parameter controls whether the peptide_mass_tolerance takes into account possible isotope errors in the precursor mass measurement. Use -8/-4/0/4/8 only for SILAC." required="false" advanced="false" restrictions="off,0/1,0/1/2,0/1/2/3,-8/-4/0/4/8" />
      <ITEM name="enzyme" value="Trypsin" type="string" description="The enzyme used for peptide digestion." required="false" advanced="false" restrictions="Trypsin,Lys-C,Lys-N,PepsinA,Asp-N,Arg-C,Chymotrypsin,Trypsin/P,glutamyl endopeptidase,CNBr,unspecific cleavage" />
      <ITEM name="second_enzyme" value="" type="string" description="The enzyme used for peptide digestion." required="false" advanced="true" restrictions="Trypsin,Lys-C,Lys-N,PepsinA,Asp-N,Arg-C,Chymotrypsin,Trypsin/P,glutamyl endopeptidase,CNBr,unspecific cleavage" />
      <ITEM name="num_enzyme_termini" value="fully" type="string" description="Specify the termini where the cleavage rule has to match" required="false" advanced="false" restrictions="semi,fully,C-term unspecific,N-term unspecific" />
      <ITEM name="allowed_missed_cleavages" value="3" type="int" description="Number of possible cleavage sites missed by the enzyme. It has no effect if enzyme is unspecific cleavage." required="false" advanced="false" restrictions="0:5" />
      <ITEM name="min_peptide_length" value="5" type="int" description="Minimum peptide length to consider." required="false" advanced="false" restrictions="5:63" />
      <ITEM name="max_peptide_length" value="63" type="int" description="Maximum peptide length to consider." required="false" advanced="false" restrictions="5:63" />
      <ITEM name="fragment_bin_tolerance" value="0.02" type="double" description="Bin size (in Da) for matching fragment ions. Ion trap: 1.0005, high res: 0.02. CAUTION: Low tolerances have heavy impact on RAM usage. Consider using use_sparse_matrix and/or spectrum_batch_size." required="false" advanced="true" restrictions="0.01:" />
      <ITEM name="fragment_bin_offset" value="0.0" type="double" description="Offset of fragment bins scaled by tolerance. Ion trap: 0.4, high res: 0.0." required="false" advanced="true" restrictions="0.0:1.0" />
      <ITEM name="instrument" value="high_res" type="string" description="Comets theoretical_fragment_ions parameter: theoretical fragment ion peak representation, high res ms/ms: sum of intensities plus flanking bins, ion trap (low_res) ms/ms: sum of intensities of central M bin only" required="false" advanced="true" restrictions="low_res,high_res" />
      <ITEM name="use_A_ions" value="false" type="bool" description="use A ions for PSM" required="false" advanced="true" />
      <ITEM name="use_B_ions" value="true" type="string" description="use B ions for PSM" required="false" advanced="true" restrictions="true,false" />
      <ITEM name="use_C_ions" value="false" type="bool" description="use C ions for PSM" required="false" advanced="true" />
      <ITEM name="use_X_ions" value="false" type="bool" description="use X ions for PSM" required="false" advanced="true" />
      <ITEM name="use_Y_ions" value="true" type="string" description="use Y ions for PSM" required="false" advanced="true" restrictions="true,false" />
      <ITEM name="use_Z_ions" value="false" type="bool" description="use Z ions for PSM" required="false" advanced="true" />
      <ITEM name="use_NL_ions" value="false" type="bool" description="use neutral loss (NH3, H2O) ions from b/y for PSM" required="false" advanced="true" />
      <ITEM name="num_hits" value="5" type="int" description="Number of peptide hits in output file" required="false" advanced="false" />
