      <ITEM name="override_charge" value="keep known search unknown" type="string" description="_keep any known_: keep any precursor charge state (from input), _ignore known_: ignore known precursor charge state and use precursor_charge parameter, _ignore outside range_: ignore precursor charges outside precursor_charge range, _keep known search unknown_: keep any known precursor charge state. For unknown charge states, search as singly charged if there is no signal above the precursor m/z or use the precursor_charge range" required="false" advanced="false" restrictions="keep any known,ignore known,ignore outside range,keep known search unknown" />
