      <ITEM name="activation_method" value="ALL" type="string" description="If not ALL, only searches spectra of the given method" required="false" advanced="false" restrictions="ALL,CID,ECD,ETD,PQD,HCD,IRMPD" />
      <ITEM name="digest_mass_range" value="600:5000" type="string" description="MH+ peptide mass range to analyze" required="false" advanced="true" />
      <ITEM name="max_fragment_charge" value="3" type="int" description="Set maximum fragment charge state to analyze as long as still lower than precursor charge - 1. (Allowed max 5)" required="false" advanced="false" restrictions="1:5" />
      <ITEM name="max_precursor_charge" value="5" type="int" description="set maximum precursor charge state to analyze (allowed max 9)" required="false" advanced="true" restrictions="1:9" />
      <ITEM name="clip_nterm_methionine" value="false" type="bool" description="If set to true, also considers the peptide sequence w/o N-term methionine separately and applies appropriate N-term mods to it" required="false" advanced="false" />
      <ITEM name="spectrum_batch_size" value="20000" type="int" description="max. number of spectra to search at a time; use 0 to search the entire scan range in one batch" required="false" advanced="true" restrictions="0:" />
      <ITEMLIST name="mass_offsets" type="double" description="One or more mass offsets to search (values subtracted from deconvoluted precursor mass). Has to include 0.0 if you want the default mass to be searched." required="false" advanced="true">
        <LISTITEM value="0"/>
